import  './cart-item.styles.scss';


const CartItem = ({item}) => {

    const { id, name, imgUrl, price, quantity } = item

    return(
        <div>
            <img src={imgUrl} alt={`${name}`} />
            <span>{name}</span>
            <span>{quantity} * {price}</span>
        </div>
    );


};

export default CartItem;
